text.paragraph:
Postmarketing cases of QT interval prolongation and ventricular arrhythmia including Torsades de Pointes have been reported in patients treated with fluoxetine. Fluoxetine should be used with caution in patients with congenital long QT syndrome; a previous history of QT prolongation; a family history of long QT syndrome or sudden cardiac death; and other conditions that predispose to QT prolongation and ventricular arrhythmia. Such conditions include concomitant use of drugs that prolong the QT interval; hypokalemia or hypomagnesemia; recent myocardial infarction, uncompensated heart failure, bradyarrhythmias, and other significant arrhythmias; and conditions that predispose to increased fluoxetine exposure (overdose, hepatic impairment, use of CYP2D6 inhibitors, CYP2D6 poor metabolizer status, or use of other highly protein-bound drugs). Fluoxetine is primarily metabolized by CYP2D6 
  [see Contraindications 
                           (4.2 
  ), Adverse Reactions (6.2), Drug Interactions (7.7, 7.8 
  ), Overdosage (10.1 
  ), and Clinical Pharmacology (12.3 
  )].

Pimozide and thioridazine are contraindicated for use with fluoxetine. Avoid the concomitant use of drugs known to prolong the QT interval. These include specific antipsychotics (e.g., ziprasidone, iloperidone, chlorpromazine, mesoridazine, droperidol,); specific antibiotics (e.g., erythromycin, gatifloxacin, moxifloxacin, sparfloxacin); Class 1A antiarrhythmic medications (e.g., quinidine, procainamide); Class III antiarrhythmics (e.g., amiodarone, sotalol); and others (e.g., pentamidine, levomethadyl acetate, methadone, halofantrine, mefloquine, dolasetron mesylate, probucol or tacrolimus) 
  [see Drug Interactions (7.7, 7.8 
  ) and Clinical Pharmacology (12.3 
  )].

                         Body as a Whole — 
Frequent: chills; 
Infrequent: suicide attempt; Rare: acute abdominal syndrome, photosensitivity reaction.

