Benzodiazepines — The half-life of concurrently administered diazepam may be prolonged in some patients [ see Clinical Pharmacology (
12.3
)] . Coadministration of alprazolam and fluoxetine has resulted in increased alprazolam plasma concentrations and in further psychomotor performance decrement due to increased alprazolam levels.

Do not use fluoxetine in combination with thioridazine or pimozide. Use fluoxetine with caution in combination with other drugs that cause QT prolongation. These include: specific antipsychotics (e.g., ziprasidone, iloperidone, chlorpromazine, mesoridazine, droperidol); specific antibiotics (e.g., erythromycin, gatifloxacin, moxifloxacin, sparfloxacin); Class 1A antiarrhythmic medications (e.g., quinidine, procainamide); Class III antiarrhythmics (e.g., amiodarone, sotalol); and others (e.g., pentamidine, levomethadyl acetate, methadone, halofantrine, mefloquine, dolasetron mesylate, probucol or tacrolimus). Fluoxetine is primarily metabolized by CYP2D6. Concomitant treatment with CYP2D6 inhibitors can increase the concentration of fluoxetine. Concomitant use of other highly protein-bound drugs can increase the concentration of fluoxetine 


  [see Contraindications (4.2


  ), Warnings and 
